import React from 'react'
import LoadingGif from '../../assets/loading2.gif';

const Loading = () => {
    const styles = {
        position: 'absolute',
        top: '0',
        left: '0',
        right: '0',
        bottom: '0',
        width: '100%',
        height: '100%',
    }
    return (
        <>
            <img style={styles} src={LoadingGif} alt='loading' />
        </>
    )
}

export default Loading
